import React from "react";
import { NavLink } from "react-router-dom";

const CartBtn = () => {
  return (
    <>
      <Nav variant="btn btn-outline-primary">
        <span className="fa fa-shopping-cart me-1"> Cart(0)</span>
      </Nav>
    </>
  );
};

export default CartBtn;
